SELECT [Time_Lookup_Day to Week Ending Sunday].[Week Ending Sunday], [DDS/Mbox Print Tbl].CLIENT, [DDS/Mbox Print Tbl].PRODUCT, [DDS/Mbox Print Tbl].MARKET, [DDS/Mbox Print Tbl].MEDI, [DDS/Mbox Print Tbl].MEDIA, [DDS/Mbox Print Tbl].PUBLICATION, [DDS/Mbox Print Tbl].[Insert Dollars], [DDS/Mbox Print Tbl].[Num Inserts] FROM ([Time_Lookup_Day to Week Ending Sunday] LEFT JOIN [DDS/Mbox Print Tbl] ON [Time_Lookup_Day to Week Ending Sunday].Date = [DDS/Mbox Print Tbl].[INSERT D]);
